import * as m3o from "@m3o/m3o-node";
export class CronService {
    constructor(token) {
        this.client = new m3o.Client({ token: token });
    }
    // Delete a cron job
    delete(request) {
        return this.client.call("cron", "Delete", request);
    }
    // List all cron jobs
    jobs(request) {
        return this.client.call("cron", "Jobs", request);
    }
    // Schedule a cron job
    schedule(request) {
        return this.client.call("cron", "Schedule", request);
    }
}
